import { Chart } from "react-google-charts";

import React from "react";

const Home = () => {
  return (
    <>
      <p>show me data</p>
      <Chart
        chartType="ScatterChart"
        data={[
          ["Age", "Weight"],
          [4, 5.5],
          [8, 12],
        ]}
        width="100%"
        height="400px"
        legendToggle
      />
    </>
  );
};

export default Home;
